    false,nt"url": null,nt"notes": "RF 5000 scale orthophoto edge lines (4000
    x 4000 meter grid cells) were generated automatically from the known corner locations.
    These corners apply to all analog (paper) orthophotos produced between 1974 and
    1994 (NAD27). This coverage should be used when digitizing data from NAD27 orthophotos.
    Orthophotos developed after 1994 utilize a different map grid system (offset to
    the west by about 130 meters), and are in NAD83. The ORTHO_83 data layer should
    be used when digitizing from NAD83 orthophotos. The ORTHO data layer should NOT
    be used for digitizing.",nt"license_title": null,nt"extras": [{ntt"key":
